import React from 'react'

export default function Song(props) {
    const {
        youtubeId,
        youtubeTime,
        name
    } = props.Song

    return (
        <div className="col-4 col-sm-3 col-lg-2 category">
            <a href={`https://youtu.be/${youtubeId}?t=${youtubeTime}`} target="_blank">   
                <img className="song-img" src={`http://img.youtube.com/vi/${youtubeId}/mqdefault.jpg`} width="100%" />
            </a>
            <a href={`https://youtu.be/${youtubeId}?t=${youtubeTime}`} target="_blank">
                <p className="song-name">${name}</p>
            </a>
        </div>
    )
}
